            [259, 1, 306, NULL, 'War history Books', 'Piece', '', 10, NULL, 'MS00259', 0, NULL, 700, 600, 600, 100, 50, 30, '<ul><li><span style=\"color: rgb[24, 24, 24]; font-family: Merriweather, Georgia, serif; font-size: 14px; font-style: normal; font-vAreant-ligatures: normal; font-vAreant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb[255, 255, 255]; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">This title presents a reassessment of the Second World War, both of its origins and its prosecution. The author examines the agendas of the warring nations and offers fresh interpretations of Britain\'s own part in the war.<br></span><span style=\"color: rgb[24, 24, 24]; font-family: Merriweather, Georgia, serif; font-size: 14px; font-style: normal; font-vAreant-ligatures: normal; font-vAreant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb[255, 255, 255]; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Gordon Corrigan looks at the course of the Second World War from a somewhat untraditional angle, viewing it as simultaneous, large-scale conflicts, which had less in common, then we usually tend to think. The book is \"a military history\", even though the account keeps a thought-stimulating ratio of military and political aspects of the war; the former, certainly, always being in the foreground.</span><span style=\"color: rgb[24, 24, 24]; font-family: Merriweather, Georgia, serif; font-size: 14px; font-style: normal; font-vAreant-ligatures: normal; font-vAreant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb[255, 255, 255]; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"></span></li></ul>', NULL, 'War-history-Books-', NULL, NULL, 'War-history-Books-', 3, 1, 2, '2022-02-09 10:55:39', '2022-03-08 19:01:25', NULL],
            [260, 1, 297, NULL, 'CV template', 'Piece', '', 10, NULL, 'MS00257', 0, NULL, 700, 650, 650, 50, 50, 30, '<ul><li>&nbsp;Apply Now for an amazing career with top Work From Home CV format Job in USA. Hourly Payout. Are you a Working Professional who is interested in working . Apply Now For your Dream Job. Remote Jobs. Click To Apply. High Salary.We\'re looking for person have good experience working in CV builder free. Join our Talent Network to learn about opportunities to property management. Part Time Jobs. Freshers Can Apply. Freelance Projects. Types: HR Jobs, Sales Jobs, Retail Jobs.</li></ul>', NULL, 'CV-template-', NULL, NULL, 'CV-template-', 3, 1, 2, '2022-02-09 11:00:50', '2022-03-08 18:48:53', NULL],
            [261, 1, 312, NULL, 'Video Production', 'Piece', '', 10, NULL, 'MS00247', 0, NULL, 500, 450, 0, 500, 100, 100, '<ul><li>&nbsp; Adventure Series introduces each system of the human body. These are the building blocks to start the journey of self-discovery and health literacy. Our anatomy books for kids cover the following systems: the Five Senses, Skeletal System, Muscular System, Nervous System, Respiratory System, Digestive System, Immune System, and much more.<br></li></ul>', NULL, 'Video-Production-', NULL, NULL, 'Video-Production-', 3, 1, 2, '2022-02-09 11:31:46', '2022-03-08 19:01:07', NULL],
            [262, 1, 309, NULL, 'School Software', 'Piece', '', 10, NULL, 'MS00247', 0, NULL, 200000, 150000, 150000, 50000, 20, 300, '<ul><li>Software is a collection of instructions that tell a computer how to work.This is in contrast to hardware, from which the system is built and actually performs the work.<br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; At the lowest programming level, executable code consists of machine language instructions supported by an individual processor—typically a central processing unit [CPU] or a graphics processing unit [GPU]. Machine language consists of groups of binary values signifying processor instructions that change the state of the computer from its preceding state. For example, an instruction may change the value stored in a particular storage location in the computer—an effect that is not directly observable to the user. An instruction may also invoke one of many input or output operations, for example displaying some text on a computer screen; causing state changes which should be visible to the user. The processor executes the instructions in the order they are provided, unless it is instructed to \"jump\" to a different instruction, or is interrupted by the operating system.<br></li></ul>', NULL, 'School-Software-', NULL, NULL, 'School-Software-', 4, 1, 2, '2022-02-09 11:38:12', '2022-03-08 18:58:39', NULL],
            [263, 1, 308, NULL, 'Pos Software', 'Piece', '', 10, NULL, 'MS00263', 0, NULL, 500000, 450000, 450000, 50000, 50, 100, '<ul><li>Software is a collection of instructions that tell a computer how to work.This is in contrast to hardware, from which the system is built and actually performs the work.<br>&nbsp;At the lowest programming level, executable code consists of machine language instructions supported by an individual processor—typically a central processing unit [CPU] or a graphics processing unit [GPU]. Machine language consists of groups of binary values signifying processor instructions that change the state of the computer from its preceding state. For example, an instruction may change the value stored in a particular storage location in the computer—an effect that is not directly observable to the user.<br> An instruction may also invoke one of many input or output operations, for example displaying some text on a computer screen; causing state changes which should be visible to the user. The processor executes the instructions in the order they are provided, unless it is instructed to \"jump\" to a different instruction, or is interrupted by the operating system.<br></li></ul>', NULL, 'Pos-Software-', NULL, NULL, 'Pos-Software-', 3, 1, 2, '2022-02-09 11:45:51', '2022-03-08 18:58:04', NULL],
            [264, 1, 310, NULL, 'Mobile Application', 'Piece', '', 10, NULL, 'MS00264', 0, NULL, 50000, 45000, 45000, 5000, 50, 48, '<ul><li>A mobile application or app is a computer program or software application designed to run on a mobile device such as a phone, tablet, or watch. ... Native applications are designed specifically for a mobile operating system, typically iOS or Android. Web apps are written in HTML5 or CSS and typically run through a browser.<br>A mobile application [also called a mobile app] is a type of application designed to run on a mobile device.<br></li></ul>', NULL, 'Mobile-Application-', NULL, NULL, 'Mobile-Application-', 4, 1, 2, '2022-02-09 11:59:17', '2022-03-08 18:56:29', NULL],
